DROP DATABASE IF EXISTS tedu;
CREATE DATABASE tedu CHARSET=UTF8;
USE tedu;

CREATE TABLE student(
    id INT AUTO_INCREMENT PRIMARY KEY ,
    name VARCHAR(30),
    age INT(3),
    gender VARCHAR(10),
    job VARCHAR(30),
    birth DATE,
    location_id INT,
    team_leader INT,
    class_id INT
);

CREATE TABLE location(
    id INT AUTO_INCREMENT PRIMARY KEY ,
    name VARCHAR(30)
);

CREATE TABLE class(
    id INT AUTO_INCREMENT PRIMARY KEY ,
    name VARCHAR(30),
    floor INT(3),
    teacher_id INT
);

CREATE TABLE teacher(
    id INT AUTO_INCREMENT PRIMARY KEY ,
    name VARCHAR(30),
    age INT(2),
    title VARCHAR(30),
    manager INT,
    salary INT(6),
    comm INT(6),
    gender CHAR(1),
    subject_id INT
);

CREATE TABLE subject(
    id INT AUTO_INCREMENT PRIMARY KEY ,
    name VARCHAR(30)
);

CREATE TABLE t_stu_subject_score(
    stu_id INT,
    subject_id INT,
    score INT(3)
);














